import React, { Component } from 'react';

class Container extends Component {

  constructor(props){
      super(props)
  }

  render() {
    return (
    <table className="table table-bordered table-hover" width="100%">
     <ul>
          <li>Name: {this.state.patientData[0]}</li>
         <li>DNA: {this.state.patientData[1].c}</li>
          <li>Level: {this.state.patientData[2].c}</li>
           <li>Wins: {this.state.patientData[3].c}</li>
        </ul>
  </table>
  )
  }
}

export default Container;
